join @maxxiko and I virtually for a special cooking demo on october 2 with our friends from @americanexpress Gold Card and @resy. Max will be showing us some of his favorite @ko_ep dishes, and I will be along for the ride as your moderator. tickets are available on Resy, exclusively for American Express Card Members.
 
@ko_ep has been on the road this summer with @americanexpress Gold Card and @resy, collaborating with 5 restaurant teams and serving up a multi-course menu in each city. They’ve already hit stops in NYC, Chicago, and San Francisco, with Los Angeles (8/29 + 8/30) and Miami (9/19 + 9/20) rounding up the tour…only a few seats remaining.
 
